export const getStaticProps = async () => {
  const key = {
    headers: {
      'X-API-KEY': process.env.apiKey
    }
  }
  const res = await fetch(
    `https://iricocco.microcms.io/api/v1/news/`,
    key
  )
  const resBody = await res.json()
  const paths = resBody.contents.map(repo => `/news/${repo.id}`)
  return {
    paths,
    fallback: false
  }
}
